import React from 'react';
import './style-form.css';
import { Row, Col, Form, Input, Button } from 'antd';

function Forms(props) {
  const [form] = Form.useForm();

  const onFinish = (values) => {
    console.log('Received values of form: ', values);
  };
  const formItemLayout = {
    labelCol: {
      xs: { span: 24 },
      sm: { span: 5 },
    },
    wrapperCol: {
      xs: { span: 24 },
      sm: { span: 5 },
    },
  };
  return (
    <>
      <Form form={form} layout="vertical">
        <Row
          // gutter={[0, 64]}
          style={{ marginTop: '83px' }}
          className="part-img"
        >
          <Col
            xs={{ span: 8, offset: 0 }}
            sm={{ span: 8, offset: 0 }}
            md={{ span: 10, offset: 0 }}
            lg={{ span: 4, offset: 2 }}
          >
            <Form.Item label="First name">
              <Input style={{ paddingTop: `12px`, paddingBottom: `12px` }} />
            </Form.Item>
          </Col>
          <Col
            xs={{ span: 8, offset: 0 }}
            sm={{ span: 8, offset: 0 }}
            md={{ span: 10, offset: 0 }}
            lg={{ span: 4, offset: 1 }}
            style={{
              marginLeft: ` 1%`,
            }}
          >
            <Form.Item label="Last name">
              <Input
                style={{
                  paddingTop: `12px`,
                  paddingBottom: `12px`,
                  marginLeft: ` 1%`,
                }}
              />
            </Form.Item>
          </Col>
        </Row>

        <Row
          // gutter={[0, 64]}
        >
          <Col
            xs={{ span: 8, offset: 0 }}
            sm={{ span: 8, offset: 0 }}
            md={{ span: 10, offset: 0 }}
            lg={{ span: 4, offset: 2 }}
          >
            <Form.Item label="First name">
              <Input style={{ paddingTop: `12px`, paddingBottom: `12px` }} />
            </Form.Item>
          </Col>
          <Col
            xs={{ span: 8, offset: 0 }}
            sm={{ span: 8, offset: 0 }}
            md={{ span: 10, offset: 0 }}
            lg={{ span: 4, offset: 1 }}
            style={{
              marginLeft: ` 1%`,
            }}
          >
            <Form.Item label="Last name">
              <Input
                style={{
                  paddingTop: `12px`,
                  paddingBottom: `12px`,
                  marginLeft: ` 1%`,
                }}
              />
            </Form.Item>
          </Col>
        </Row>
      </Form>
    </>
  );
}

export default Forms;
